import React from 'react'
import Heading from './Heading'
import Paragraph from './Paragraph'
import Orderlist from './Orderlist'

function App()
{
    return(
        <>
          <Heading/>
          <Paragraph/>
          <Orderlist/>
         </>
    )
}

export default App;
